import axios from 'axios';
import { useState, useEffect } from "react";
import {BrowserRouter ,Route, Routes} from 'react-router-dom'
import Home from './pages/Home';


function App() {

  return (

    <div className="App">
      <h1>Selam</h1>
      <Routes>
      <Route path='/' element={Home}/>


      </Routes>
    </div>
  );
}

export default App;
